import styles from "./header.module.scss"

/////////////////////////////////////////////////////////////////////////////

const Header = () => {
  return (
    <header className={styles.wrapper}>
      <div className={styles.logo_wrap}>
        <Image src={"/images/logo-white.png"} height={35} width={100} />
      </div>
    </header>
  )
}

export default Header
